//import '../../App.css';
import React from 'react';
import welcomImage from '../../assets/welcomImg.png';
import { HomeContainer,leftside,rightside,title,pg,labo } from './HomeElements';
//style={{ backgroundColor: "#" + `${randomColor}` }}
//let randomColor = Math.floor(Math.random() * 16777215).toString(16);
//<div class="HomeContainer" ></div>
function Home(){
    return (
        <div>
            <HomeContainer>
                <leftside>
                    <div class="title">
                        Bienvenue !
                    </div>
                    <div class="pg">
                    Serveur d'administration des données pour les enquêtes HCERES
                    </div>
                </leftside>
                <div class="rightside">
                    <img class="labo" src={welcomImage} alt= "Hello" />
                </div>
            </HomeContainer>
        </div>
    );
};

export default Home;
